import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { Search, Home, Calendar, Ticket, User, Menu } from 'lucide-react';

const Events = () => {
  const navigate = useNavigate();
  const [activeFilter, setActiveFilter] = useState('All');
  const filters = ['All', 'Tech', 'Cultural', 'Sports', 'Workshops'];

  // Fix: Added the missing styles object
  const styles = {
    container: { maxWidth: '375px', margin: '0 auto', backgroundColor: '#fff', minHeight: '100vh', fontFamily: 'sans-serif' },
    header: { display: 'flex', justifyContent: 'space-between', alignItems: 'center', padding: '16px', borderBottom: '1px solid #f1f5f9' },
    searchContainer: { position: 'relative', padding: '16px' },
    searchIcon: { position: 'absolute', left: '28px', top: '50%', transform: 'translateY(-50%)', color: '#94a3b8' },
    input: { width: '100%', padding: '10px 40px', borderRadius: '10px', border: '1px solid #f1f5f9', backgroundColor: '#f8fafc', boxSizing: 'border-box' },
    filterRow: { display: 'flex', gap: '10px', overflowX: 'auto', padding: '0 16px 15px', scrollbarWidth: 'none' },
    filterChip: (isActive) => ({ padding: '8px 15px', borderRadius: '10px', border: 'none', backgroundColor: isActive ? '#e0e7ff' : '#f8fafc', color: isActive ? '#2563eb' : '#64748b', fontWeight: 'bold', cursor: 'pointer' }),
    eventCard: { margin: '0 16px 20px', borderRadius: '16px', border: '1px solid #f1f5f9', overflow: 'hidden' },
    bottomNav: { position: 'fixed', bottom: 0, left: '50%', transform: 'translateX(-50%)', width: '100%', maxWidth: '375px', backgroundColor: 'white', display: 'flex', justifyContent: 'space-around', padding: '12px 0', borderTop: '1px solid #f1f5f9' },
    navItem: { display: 'flex', flexDirection: 'column', alignItems: 'center', color: '#94a3b8', cursor: 'pointer', fontSize: '11px' }
  };

  return (
    <div style={styles.container}>
      <header style={styles.header}>
        <h2 style={{margin:0}}>Events</h2>
        <Menu size={24} />
      </header>

      <div style={styles.searchContainer}>
        <Search size={18} style={styles.searchIcon} />
        <input style={styles.input} type="text" placeholder="Search events..." />
      </div>

      <div style={styles.filterRow}>
        {filters.map(f => (
          <button key={f} onClick={() => setActiveFilter(f)} style={styles.filterChip(activeFilter === f)}>{f}</button>
        ))}
      </div>

      <div style={{height: 'calc(100vh - 250px)', overflowY: 'auto'}}>
        {[1, 2, 3].map(i => (
          <div key={i} style={styles.eventCard}>
            <div style={{height:'150px', backgroundColor:'#2563eb'}} />
            <div style={{padding:'15px'}}>
              <h4 style={{margin:0}}>Event Title {i}</h4>
              <button style={{width:'100%', marginTop:'10px', padding:'10px', backgroundColor:'#5c5cfc', color:'white', border:'none', borderRadius:'8px'}}>Register</button>
            </div>
          </div>
        ))}
      </div>

      <nav style={styles.bottomNav}>
        <div style={styles.navItem} onClick={() => navigate('/')}><Home size={22} /><span>Home</span></div>
        <div style={{...styles.navItem, color: '#2563eb'}} onClick={() => navigate('/events')}><Calendar size={22} /><span>Events</span></div>
        <div style={styles.navItem} onClick={() => navigate('/my-events')}><Ticket size={22} /><span>My Events</span></div>
        <div style={styles.navItem}><User size={22} /><span>Profile</span></div>
      </nav>
    </div>
  );
};

export default Events;
